import React, { useState } from 'react'
import './Signup.css'
import username_icon from '../Assets/username.png'
import email_icon from '../Assets/email.png'
import password_icon from '../Assets/password.png'

const  Signup = ()=>{
    const [user, setUser] = useState({
        Username:"",
        Email:"",
        Password:""
    });
    const handleInput = (e) =>{
      console.log(e);
      let name = e.target.name;
      let value = e.target.value;
      setUser({
        ...user,
        [name]:value,

      })

    };
    const handleSubmit = (e)=>{
        e.preventDefault();
        alert(user);

    };
    return (
        <div className='container'>
              <div className="header">
                <div className="text">Signup</div>
                <div className="underline"></div>
              </div>
              <form onSubmit={handleSubmit}>
              <div className="inputs">
                
                <div className="input">
                    <img src={username_icon} alt="" />
                    <input type="text" placeholder='Name' value={user.Username} onChange={handleInput}/>
                </div>
                <div className="input">
                    <img src={email_icon} alt="" />
                    <input type="email" placeholder='Email' value={user.Email} onChange={handleInput} />
                </div>
                <div className="input">
                    <img src={password_icon} alt="" />
                    <input type="password" placeholder='Password' value={user.Password} onChange={handleInput}/>
                </div>
                <div className="forgot-password">Lost Password <span>Click here</span></div>
                <div className="submit-container">
                    <div className="submit"><button></button></div>
                    <div className="submit">Login</div>
                </div>

              </div>
              </form>
        </div>
    );
}
export default Signup
